import React from "react";
import { Col, Container, Row } from "react-bootstrap";
import BasketItems from "./BasketItems";

const BasketContainer = () => {
  return (
    <Container>
      <Row>
        <Col md={8}><BasketItems /></Col>
        <Col md={4}>right</Col>
      </Row>
    </Container>
  );
};

export default BasketContainer;
